import React from 'react';
import Card from '../../components/Card/Card';
import Container from '@material-ui/core/Container';
import './Home.css';


function Home() {
  return (
    <div className="home">
      <h1>Home Page</h1>
      <Container maxWidth="sm">
        <Grid container spacing={1}>
          <Grid container item xs={12} spacing={3}>
            <FormRow />
          </Grid>
        </Grid>
        <Card />
        <Card />
        <Card />
        <Card />
        <Card />
        <Card />
      </Container>
    </div>
  )
}

export default Home
